import React from "react";

const Profile = ({ user }) => {
  return (
    <div className="profile">
      <div className="profile__info">
        <img src={user.avatar} alt="" />
        <h2>{user.fullname}</h2>
        <p>{user.email}</p>
        <div className="profile__info-stat">
          <p>Wins : {user.wins}</p>
          <p>Losing : {user.losing}</p>
          <p>Stat : {((user.wins + user.losing) / 100) * user.wins}</p>
          <p>Rait : {user.rait}</p>
        </div>
      </div>
      <div className="profile__games"></div>
    </div>
  );
};

export default Profile;
